import { Accordion, AccordionDetails, AccordionSummary, Box, Container, Typography } from "@mui/material";

export default function QuestionAccordion() {
    return (
        <Accordion>
            <AccordionSummary>
                <Typography>Question 1</Typography>
            </AccordionSummary>
            <AccordionDetails>
                <Typography>
                    Answer 1
                </Typography>
            </AccordionDetails>
        </Accordion>
    );
}
